import React, { Component } from 'react';

import styles from './Feedback.module.scss';

export default class Feedback extends Component {
    constructor(props){
        super(props);
    }


    render() {

        return (
            <div className={styles.block}>
                <h1 className={styles.block__title_active}>Feedback</h1>
                <h1 className={`${styles.block__title} ${styles.block__title_active}`}>Feedback Active</h1>
            </div>
        );
    }
}
